import React, { useEffect } from 'react';
import { useState } from 'react';
import { Bar } from 'react-chartjs-2';
import { Line } from 'react-chartjs-2';


const BarChart = () => {

    const [people, getPeople] = useState([{}]);
    useEffect(()=>{
      fetch('http://localhost:3001/data')
      .then(res => res.json())
      .then(data => {
        getPeople(data);
      })
    },[]);
  
    console.log(people);
     
    return (
        <div>
            <h1>Line Chart</h1>
            {/* Create line chart with people variable with age on x axis and counts as y axis */}
            <Line
                data={{
                    labels: people.map((val) => {
                        return val.age;
                    }),
                    datasets: [
                        {
                            label: "Number of People",
                            data: people.map((val) => {
                                return val.count;
                            }),
                            backgroundColor: [
                                "rgba(75, 192, 192, 0.6)",
                            ],
                            borderWidth: 4
                        }
                    ]
                }}
                height={400}
                width={600}
                options={{
                    maintainAspectRatio: false
                }}
            />



            
        </div>
    )
}

export default BarChart;
